import React from 'react';
import './App.css';
import {fetchData} from './services/get-data';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: []
    }
  }

  componentDidMount () {
    this.getData()
  }

  getData () {
    fetchData()
    .then(data => {
      this.setState({
        data: data.results
      })
    })
  }

  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
